import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <Todolist />
            <Todolist />
            <Todolist />
        </div>
    );
}

const Todolist = () => {
    return (
        <div>
            <h3>What to learn ?</h3>
            <div>
                <input />
                <button>+</button>
            </div>
            <ul>
                <li><input type="checkbox" checked={true} /><span>CSS</span></li>
                <li><input type="checkbox" checked={true} /><span>HTML</span></li>
                <li><input type="checkbox" checked={false} /><span>REACT</span></li>
            </ul>
        </div>
    )
}

export default App;
